import './App.css';


import SiteNav from './components/SiteNav';
import Landing from './components/Landing';
import Login from './components/Login';
import Signup from './components/Signup';
import {Link, Route} from 'react-router-dom';

function App() {





  return (
    <>
    <head>
		<title>Co-Make</title>
		<meta charset="utf-8" />
	</head>

  <body>
    {/* No routing for the site navigation so it shows everywhere */}
    <SiteNav />

    {/* Route for root URL to render the landing page */}
    <Route excact path='/' component='landing'>
      <Landing />
    </Route>
    {/* Route for the signup url to display the signup form*/}
    <Route path='/signup' component='Signup'>
      <Signup />
    </Route>

    {/* This is just for display for now to test the login form */}
    <Login />


    {/* This component will be the lower section of the landing page showing member reviews*/}
    {/* <MemberReviews /> */}

  </body>

    </>
  );
}

export default App;
